import React from "react";
import Board from "./Board";
import "./App.css";

/** Simple app that just shows the LightsOut game. */

function App() {
  return (
    <div className="App">
      <Board nrows={6} ncols={6} chanceLightStartsOn={.75} />
      <button>Hello</button>
    </div>
  );
}

export default App;
